import React, { useEffect } from "react";
import M from 'materialize-css/dist/js/materialize.min.js';


function Navbar() {

  useEffect(() => {
  }, []);

  document.addEventListener('DOMContentLoaded', function() {
    let elems = document.querySelectorAll('.sidenav');
    M.Sidenav.init(elems);
  });

  return (
    <div>

      <nav className="nav-border">
        <div className="nav-wrapper">
          <div className="container">

            <div className="row">
              <div className="col s2">
                <a href="/" className="brand-logo">Logo</a>
                <a href="/" data-activates="mobile-menu" className="button-collapse"><i className="material-icons">menu</i></a>
              </div>

              <div className="col s8 hide-on-med-and-down">
                <form>
                  <div className="input-field">
                    <input id="search" type="search" required />
                    <label className="label-icon" for="search"><i className="material-icons">search</i>
                    </label>
                    <i className="material-icons closed">close</i>
                  </div>
                </form>
              </div>

              <div className="col s2 hide-on-med-and-down">
                <ul className="right">
                  <li><a href="/"><i className="material-icons">power_settings_new</i></a>
                  </li>
                </ul>
              </div>
            </div>

            <ul className="sidenav" id="mobile-menu">
              <li><a href="sass.html">Sass</a></li>
              <li><a href="badges.html">Components</a></li>
              <li><a href="collapsible.html">JavaScript</a></li>
            </ul>

          </div>
        </div>
      </nav>



    </div>
  );

}

export default Navbar;
